- input: "TEXT\x1CC00033134\x1C1\x1C\x1CF3XA\x1CItem 1    Schedule A supporting Line
    15 of the report discloses an offset to an operating expenditure totaling $5,467
    from Travelport.  Travelport is the parent company that owns and operates Orbitz
    for Business, a hotel and travel booking service used by the Colorado Republican
    Party to provide lodging and airfare to volunteers in connection with the 2008
    federal campaign effort.  The following three expenditures were made using federal
    funds on the following dates to Orbitz for Business.  10/6/2008, check 2779, $22,000.00
    \ 10/21/2008, check 2829, $34,000.00  11/14/2008, check 2952, $15,000.00  The
    Travelport offset corresponds to a partial refund for travel insurance and other
    travel-related expenses not utilized.  The entry Travelport will be amended to
    Orbitz for Business to correspond to the expenditures made in connection with
    the campaign.  Item 2   The Committee uses the following best efforts to obtain
    the required contributor information:  First, we include a request for the required
    information on our original solicitation.   Second, if the information is not
    received by the contributor we send out a second request for the information within
    30 days.  This is a stand alone request which includes a pre- addressed envelope.
    \ Once again we notify the contributor of the requirement to provide this information.
    \ Third, if the information is received we file an amendment to the original report
    to include the missing information.         \n"
